Un volcan est un ensemble géologique terrestre, sous-marin ou extra-terrestre qui résulte de la montée d'un magma puis de l'éruption d'une partie de ce magma. Le magma provient de la fusion partielle du manteau et exceptionnellement de la croûte terrestre. L'éruption peut se manifester, de manière plus ou moins combinée, par des émissions de lave, par des émanations ou des explosions de gaz, par des projections de tephras, par des phénomènes hydromagmatiques, etc. Les laves refroidies et les retombées de tephras constituent des roches éruptives qui peuvent s'accumuler et atteindre des milliers de mètres d'épaisseur formant ainsi des montagnes ou des îles. Selon la nature des matériaux, le type d'éruption, la fréquence d'éruption et l'orogenèse, les volcans prennent des formes variées, la plus typique étant celle d'une montagne conique couronnée par un cratère ou une caldeira. La définition de ce qu'est un volcan a évolué au cours des derniers siècles en fonction de la connaissance que les géologues en avaient et de la représentation qu'ils pouvaient en donner. Les volcans sont souvent des édifices complexes qui ont été construits par une succession d'éruptions et qui, dans la même période, ont été partiellement démolis par des phénomènes d'explosion, d'érosion ou d'effondrement. Il est ainsi fréquent d'observer diverses structures superposées ou emboitées. Au cours de l'histoire d'un volcan, les types d'éruptions peuvent aussi varier. Néanmoins, il est d'usage, dans le cadre de la vulgarisation scientifique, de considérer qu'il existe au monde deux types généraux : 
*  les volcans effusifs, ou « volcans rouges », aux éruptions relativement calmes qui émettent des laves fluides sous la forme de coulées. Ce sont les volcans de « point chaud », et les volcans d'« accrétion » principalement représentés par les volcans sous-marins des dorsales océaniques ; 
*  les volcans explosifs, ou « volcans gris », aux éruptions explosives qui émettent des laves pâteuses et des cendres sous la forme de nuées ardentes ou coulées pyroclastiques et de panaches volcaniques. Ils sont principalement associés au phénomène de subduction comme les volcans de la ceinture de feu du Pacifique. On compte environ 1 500 volcans terrestres actifs dont une soixantaine en éruption par an. Les volcans sous-marins sont bien plus nombreux. Le « volcanisme » est l'ensemble des phénomènes associés aux volcans et à la présence de magma. La « volcanologie » ou (beaucoup plus rarement) « vulcanologie » est la science de l'étude, de l'observation et de la prévention des risques des volcans. Le terme « volcan » tire son origine de Vulcano, une des Îles Éoliennes nommée en l'honneur de Vulcain, le dieu romain du feu et des forgerons dont l'équivalent dans le panthéon grec est Héphaïstos.
